function Sticker({ src, size, top, left, right, bottom, opacity, rotate, anim, dur, delay }) {
  return (
    <img src={src} alt="" style={{
      position: "absolute", width: size, height: size, objectFit: "contain",
      top, left, right, bottom,
      opacity: opacity ?? 0.85,
      transform: `rotate(${rotate ?? 0}deg)`,
      pointerEvents: "none", zIndex: 0,
      animation: `${anim || "sf1"} ${dur || 5}s ease-in-out ${delay || 0}s infinite alternate`,
      filter: "drop-shadow(0 2px 6px rgba(139,106,174,0.1))",
    }} />
  );
}

